perspectives.style:
@controls {
  bottom {
    showcase {
      target: element;
      by: "element type";
      as: buttons;
      multiple: true;
      default: select-none;
      mode: normal;
    }
  }
}

@settings {
  template: systems;
  element-size: 8;
  connection-size: 3;
  layout: static;
  connection-curvature: 0.38;
  opposite-label: "";
  same-label: "Same direction";
  font-size: 27;
  element-text-align: bottom;
  opposite-style: dashed;
  foreground-opacity: 1;
  background-opacity: 0.2;
  theme: dark;
  element-color: categorize("Element Type", neon);
}

/* Same direction */
connection["connection type"="Same"] {
  color: #3596c0;
  style: solid;
}

/* Opposite direction */
connection["connection type"="Opposite"] {
  color: #b60027;
  style: solid;
}

